const SkillsBanner = () => {
  const skills = ["Web Developer", "XR Designer", "Photographer"];
  let text = "";

  for (let i = 0; i < skills.length; i++) {
    text += skills[i];
    if (i < skills.length - 1) {
      text += (
        <img
          src={require("../assets/Portfolio_Bulletin_.png").default}
          alt="bullet point"
        />
      );
    }
  }

  return (
    <div className="w-full flex justify-around border-y-4 border-stone-950">
      <h1 className="text-[2rem] font-source_san_3 font-bold ">{text}</h1>
      <img
        src={require("../assets/Portfolio_Bulletin_.png")}
        alt="bullet point"
        className="object-scale-down w-full"
      />
    </div>
  );
};

export default SkillsBanner;
